import React from "react";
import perfilHome from "../Img/perfilHome.png";
import "./Contact.css";
const Contact = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col d-flex justify-content-center h-card-contact">
          <div className="container-contact-card">
            <div className="cover-photo">
              <img src={perfilHome} alt="FotoFondo" className="perfil " />
            </div>
            <div className="col-auto myName fs-6  d-flex justify-content-end mx-2 pt-2">
              Ricardo Ramirez
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Contact;
